import React, { useEffect, useState } from 'react';
import { Box, Heading, Flex, Stat, StatLabel, StatNumber } from '@chakra-ui/react';

const Metrics = () => {
  const metrics = [
    { label: 'Participants', value: 1000 },
    { label: 'Countries', value: 50 },
    { label: 'Projects Submitted', value: 200 }
  ];

  return (
    <Box id="metrics" py={12} px={8}>
      <Heading mb={8}>Our Metrics</Heading>
      <Flex justify="space-around">
        {metrics.map((metric, index) => (
          <Stat key={index} textAlign="center">
            <StatNumber>{metric.value}</StatNumber>
            <StatLabel>{metric.label}</StatLabel>
          </Stat>
        ))}
      </Flex>
    </Box>
  );
};

export default Metrics;
